Grown Ups (2010)  

Verenigde Staten
Komedie
102 minuten

geregisseerd door Dennis Dugan
met Adam Sandler, Kevin James en Chris Rock

Vijf goede vrienden en teammaten hebben elkaar sinds hun middelbare school niet meer gezien. Om hun overleden basketbalcoach te herdenken besluiten ze, 35 jaar later tijdens het '4th of July' weekend, allemaal nog eens bij elkaar te komen. Ze ontdekken al snel dat ze allemaal erg veranderd zijn in die 35 jaar...

Vertaald door Tokke &amp; Suurtje, Nice work team!!

